import { GET_MOVEMENT } from '../actions/constants.js';

const intialState = {
    movements: [
        {
          id: 1,
          name: 'squat',
          weight: '100'
        },
        {
          id: 2,
          name: 'bench',
          weight: '200'
        },
        {
          id: 3,
          name: 'deadlift',
          weight: '300'
        },
      ] 
};

const movementReducer = (state = intialState, action) => {
    switch (action.type) {
        case GET_MOVEMENT:
            return { ...state }
        default:
            return state;
    }
};

export default movementReducer;
